import ReactHLS from 'react-hls-player';

class Player extends React.Component {
    render(){
        return (
            <div className="container-fluid">
                <ReactHLS url={this.props.url} autoplay="true" width="1280" height="720"/>
            </div>
        )
    }
}

export default Player;
